def sum_list (list1, list2):
    list_result = []
    if len(list1)!=len(list2):
        print("length error!")
        exit(1)
    list_result = [x + y for (x, y) in zip(list1, list2)]

    print("sum:",sum(list_result))
    print("length:",len(list_result))

    return list_result

